import React, { Component } from 'react';
import './App.css';
import Movie from './movie';


class App extends Component {
// 순서: (1) componentWillMount (2) render (3) componentDidMount
// 업데이트: (1) componentWillReceiveProps (2)shouldComponentUpdate == ture (3) componentWillUpdate
// (4) render (5) componentDidUpdate

state = { // state을 바꿀땐 setState 사용
  greeting: 'Hello~',
  movies: [
    {
      title: "Matrix",
      poster: "data:image/jpeg;base64,"
    },
    {
      title: "Fill Metal Jacket",
      poster: "data:image/jpeg;base64,"
    },
    {
      title: "Oldlboy",
      poster: "data:image/jpeg;base64,"
    },
    {
      title: "Star Wars",
      poster: "data:image/jpeg;base64,"
    }
  ]
}

componentDidMount(){
  setTimeout(() => {
    this.setState({
      movies: [
        ...this.state.movies, // 이전 영화 리스트는 그대로, 영화 한개 추가라는 뜻
        // ...this.state.movies 삭제하면 전체리스트를 대체하는 것
        {
          title: "Trainspotting",
          poster: "https://t1.daumcdn.net/cfile/blog/22728A40564EF08D0C"
        }
      ]
    })
  }, 5000)
}

  render() {
    return (
      <div className="App">
        {this.state.movies.map((movie, index) => {
         return <Movie title={movie.title} poster={movie.poster} key={index}/>
        })}
      </div>
    )

  }
}

export default App;
